Hi,
I think there's a bug in this line of code:

func swap(x, y string) string, string {
	return y, x
}

 command-line-arguments
/tmp/sandbox457775645/main.go:5: syntax error: unexpected comma, expecting semicolon or newline

I think it should be:

func swap(x, y string) (string, string) {
	return y, x
}
